import React from 'react'
import Autosuggest from 'react-autosuggest'

function Search ( {suggestion}, {onSuggestionsFetchReq}, {onSuggestionsClearReq},
	            {getSuggestionVal}, {renderSuggestions},{inputProp}) {
	return (
		<section className="searchbox-wrap">
			{/* <input 
				type="text" 
				placeholder="Search for a movie..." 
				className="searchbox" 
				onChange={handleInput}
				onKeyPress={search}
			/> */}
            <Autosuggest
                suggestions={suggestion}
                onSuggestionsFetchRequested={onSuggestionsFetchReq}
                onSuggestionsClearRequested={onSuggestionsClearReq}
                getSuggestionValue={getSuggestionVal}
                renderSuggestion={renderSuggestions}
                inputProps={inputProps}
            />		
			</section>
	)
}

export default Search
